import React from "react";
import { Container, Row, Col, Carousel } from "react-bootstrap";
import "../styling/hero.css";
import hero1 from "../assets/hero/hero1.jpg";
import hero2 from "../assets/hero/hero2.jpg";
import hero3 from "../assets/hero/hero3.jpg";
import hero4 from "../assets/hero/hero4.jpg";

export const Hero = () => {
  return (
    <div className="hero">
      <Carousel fade>
        <Carousel.Item>
          <img src={myPhoto} alt="Divya Kulkarni" />
          <Carousel.Caption>
            <h3>Yours truly</h3>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img src={fuji} alt="fuji" />
          <Carousel.Caption>
            <h3>Mt Fuji: 3770m</h3>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img src={film} alt="boat" />
          <Carousel.Caption>
            <h3>Boat on Ishigaki Island</h3>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img src={heart} alt="heart" />
          <Carousel.Caption>
            <h3>Pen Sketch</h3>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
      <img src={heroImage} alt="hero" className="img-fluid" />
    </div>
  );
};
